    <>
      <div className="bg-white rounded-lg w-1/2 m-auto h-4/5 mt-8">
        <p> {location}</p>
        <p> {date} </p>
        <Weather_icons_cloudy />
      </div>
    </>
  );
};

export default ActualPos;
